import React from 'react';

class Search extends React.Component {

    constructor(props) {
      super(props)
      this.state = { res: ""}
    }

    render() {
      return(
        <div>
          <p>{this.state.res}</p>
        </div>
      )
    }

    callAPI() {
      fetch("http://localhost:9000/testAPI")
        .then((data) => this.setState({res: data}))
    }

    componentDidMount() {
      this.callAPI();
    }

  }


  export default Search;
